import Landing from '../../components/Landing/Landing';

interface props {
  socket: any;
  history: any;
}

function App({ socket }: any) {
  return (
    <BrowserRouter>
      <Routes />
      <Landing />
    </BrowserRouter>
  );
}

export default App;
